import React from 'react'
import NavListItem from '../components/NavListItem'

const Header = () => {
  return (
    <header>
        <a className="logo" href=""><img src="" className="img-logo" alt="" /> Movies</a>
        <ul className="nav">
          <NavListItem/>
        </ul>

    </header>
  )
}

export default Header
